// components/UserTypeSelection.js
import React from 'react';

const UserTypeSelection = ({ onSelectUserType }) => {
    return (
        <div>
            <h2>Select User Type</h2>
            <button onClick={() => onSelectUserType('doctor')}>I am a Doctor</button>
            <button onClick={() => onSelectUserType('patient')}>I am a Patient</button>
        </div>
    );
};

export default UserTypeSelection;
